sys_variable_value.value:
(function execute(inputs, outputs) {

  var consoleurl = "";
  var uem_url = "";
  var uem_url_display = gs.getProperty('x_vmw_ws1uem.WS1UEMURLDisplay');

  if ( uem_url_display == "true") {
  	uem_url = gs.getProperty('x_vmw_ws1uem.WS1UEMURL');
  	uem_url = uem_url + "/AirWatch/#/AirWatch/Device/Details/Summary/" + inputs.id;
  	consoleurl = "[code]<a href=" + uem_url + ">Workspace ONE Console</a>[/code]";
  }

  outputs.consoleurl = uem_url;
  outputs.consoleurlencoded = consoleurl;

})(inputs, outputs);

